import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { ProductListComponent } from './ProductsModule/Infrastracture/Components/product-list-component/product-list.component';
import { Repository } from './ProductsModule/Infrastracture/Persistence/Repositories/repository';
import { IRepository } from './ProductsModule/Core/Domain/Repositories/IRepository';
import { INumberEqualService, NUMBER_EQUAL_CONDITIONS, NumberBeetween3And5, NumberIsEven, NumberIsOdd } from './ProductsModule/Core/Services.Abstractions/INumberEqualService';
import { ICounterService } from './ProductsModule/Core/Services.Abstractions/ICounterService';
import { NumberCounterService } from './ProductsModule/Core/Services/number-counter.service';
import { NumberEqualService } from './ProductsModule/Core/Services/number-equal.service';
import { IDistinctArrayService } from './ProductsModule/Core/Services.Abstractions/IDistinctService';
import { DistinctArrayService } from './ProductsModule/Core/Services/distinct-array.service';


@NgModule({
  declarations: [
    AppComponent,
    ProductListComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule
  ],
  providers: 
  [
    { provide: NUMBER_EQUAL_CONDITIONS, useValue: [
      new NumberBeetween3And5(),
      new NumberIsEven(),
      // new NumberIsOdd(),
    ]},
    {provide: IRepository, useClass: Repository },
    {provide: ICounterService, useClass: NumberCounterService },
    {provide: INumberEqualService, useClass: NumberEqualService },
    {provide: IDistinctArrayService, useClass: DistinctArrayService },
  ],
  bootstrap: [AppComponent]
})
export class AppModule { }
